webpackJsonp([0xb33d6d4f06da],{332:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Stephen Quick",author:"Stephen Quick"}},markdownRemark:{id:"c:/Users/stephen/Documents/Git/stepquick.github.io/src/pages/disable-gpg-for-deployment/index.md absPath of file >>> MarkdownRemark",html:'<p>I’ve noticed that Octopress Deploy doesn’t appear to allow deployment using Git if GPG is enabled. What I had to do to get around it is temporarily disable GPG.</p>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code class="language-text">git config --global commit.gpgsign false</code></pre>\n      </div>\n<p>After disabling it I can run <code class="language-text">octopress deploy</code> to commit my new changes to the live site. Doesn’t appear to be any issues listed for it, so if you come across this that’s what I ended up having to do to get deploy to work.</p>',frontmatter:{title:"Disable GPG for Octopress Deploy",date:"August 05, 2016"}}},pathContext:{slug:"/disable-gpg-for-deployment/",previous:{fields:{slug:"/how-to-disable-chrome-web-security-for-development/"},frontmatter:{title:"How to disable Chrome Web Security for development"}},next:{fields:{slug:"/quick-config-for-mariadb-and-laravel/"},frontmatter:{title:"Configuration for using MariaDB with Laravel and El Capitan"}}}}}});
